(1,NULL,NULL,1,'001','MacBook Pro 15s',85900,37,'mac15.webp','โปรเซสเซอร์ 2.6GHz\r\nIntel Core i7 แบบ 6‑core ความเร็ว 2.6GHz ที่มี Turbo Boost สูงสุด 4.5GHz พร้อมแคช L3 แบบใช้ร่วมกันขนาด 12MB\r\n\r\nสามารถปรับแต่งให้เป็น Intel Core i9 แบบ 8‑core ความเร็ว 2.4GHz ที่มี Turbo Boost สูงสุด 5.0GHz พร้อมแคช L3 แบบใช้ร่วมกันขนาด 16MB ได้\r\n\r\nพื้นที่จัดเก็บข้อมูล1\r\n512GB\r\nSSD ความจุ 512GB\r\nสามารถปรับแต่งให้เป็น SSD ความจุ 1TB, 2TB หรือ 4TB ได้\r\n\r\nหน่วยความจำ\r\nหน่วยความจำ DDR4 ออนบอร์ด ความเร็ว 2400MHz ขนาด 16GB\r\nสามารถปรับแต่งให้เป็นหน่วยความจำ 32GB ได้',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
(2,NULL,NULL,1,'002','MacBook Pro 13',1900,6,'mac13.webp','Description MacBook Pro 13',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
(3,NULL,NULL,2,'003','Apple iPad Air 10.9-inch Wi-Fi 64GB Blue 2022 (5th Gen)',23900,143,'H6ddgbc71pl5dhaJbJZToWn5G3u6NEcd9BTEbuFU.jpg','iPad Air (5th Gen) รุ่นล่าสุดสำหรับ iPad Air อัพเกรดขึ้นไปอีกขั้นด้วยจอภาพที่ใหม่และกว้างขึ้น พร้อมชิปประมาลผลที่ทรงประสิทธิภาพ ให้การทำงานหรือเล่นเกมหนัก ๆ ตัดต่อคลิป วาดรูป กลายเป็นเรื่องง่าย ๆ  แต่ยังคงความเบาและบางไว้ได้อยู่',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
(4,NULL,NULL,2,'004','Apple iPhone 15 Pro Max 256GB Blue Titanium',43000,84,'bAS8UHEQRNv7GmmpCZJL1mYFJD3RUNkxjhf5y0q1.jpg','iPhone 15 Pro Max เปลี่ยนวัสดุตัวเครื่องเป็นไทเทเนียมที่แข็งแกร่งและมีน้ำหนักเบาเกรดเดียวกับที่ใช้ในอุตสาหกรรมอวกาศ พร้อมกล้องระดับโปรที่อเนกประสงค์ยิ่งกว่าเดิม ถ่ายภาพระยะใกล้ได้คมชัดจากที่ที่ไกลกว่าเดิมด้วยกล้องเทเลโฟโต้ 5 เท่า ให้คุณได้ภาพจากระยะที่ชอบในมุมที่ใช่\r\n\r\nการเชื่อมต่อระดับโปร ด้วยช่องต่อ USB-C\r\nชิป A17 Pro GPU ระดับโปรให้เล่นเกมมือถือรู้สึกเต็มอิ่มสมจริงยิ่งขึ้น\r\nปุ่มแอ็คชั่นที่ปรับแต่งได้ตามต้องการทั้ง ปิดเสียง กล้อง บันทึกเสียง และอีกมากมาย',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
(5,NULL,NULL,2,'005','Apple iPhone 14 128GB Purple',24700,74,'G23Hz8qpHsm0BNgjTfJmr8FGSs8WPhBvtH4agZHC.webp','iPhone 14 มาพร้อมระบบกล้องคู่ที่น่าประทับใจที่สุดเท่าที่เคยมีมาบน iPhone ซึ่งถ่ายภาพได้อย่างน่าทึ่งทั้งในที่ที่มีแสงน้อยและแสงจ้า  นอกจากนี้ยังมีการตรวจจับการชนกัน ซึ่งเป็นคุณสมบัติใหม่ด้านความปลอดภัย ที่พร้อมโทรขอความช่วยเหลือเมื่อคุณไม่สามารถ\r\n\r\nจอภาพ Super Retina XDR ขนาด 6.1 นิ้ว\r\n ระบบกล้องสุดล้ำเพื่อภาพถ่ายที่ดียิ่งขึ้นในทุกสภาพแสง\r\n โหมดภาพยนตร์ที่วันนี้มาในแบบ Dolby Vision ระดับ 4K สูงสุด 30 fps\r\n โหมดแอ็คชั่นเพื่อวิดีโอแบบถือถ่ายที่นิ่งและไหลลื่น\r\n แบตเตอรี่ที่ใช้งานได้ตลอดวันและเล่นวิดีโอได้นานสูงสุด 20 ชั่วโมง\r\n ชิป A15 Bionic พร้อม GPU แบบ 5-core เพื่อประสิทธิภาพที่เร็วสุดขั้ว',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
(7,NULL,NULL,2,'006','iPhone 12 Pro Max 256GB',32500,121,'JiNu0801Sd2NzWZB6wgvSVA1x12RiyWN63zJsSzx.webp','iPhone 12 Pro Max มาพร้อมชิพที่เร็วที่สุดในสมาร์ทโฟนอย่าง A14 Bionic, ระบบกล้องระดับโปรเพื่อการถ่ายภาพในสภาวะแสงน้อยที่สวยเหลือเชื่อ และจอภาพ Super Retina XDR ที่ใหญ่ขึ้น บอกเลยว่า ก้าวหน้าอย่างก้าวกระโดด\r\n\r\nจอภาพ Super Retina XDR ขนาด 6.7 นิ้ว\r\nCeramic Shield ซึ่งแข็งแกร่งกว่ากระจกไหนๆ บนสมาร์ทโฟน\r\nรองรับ 5G\r\nชิพที่เร็วที่สุดเท่าที่เคยมีมาในสมาร์ทโฟนอย่างชิพ A14 Bionic\r\nระบบกล้องระดับโปรที่ประกอบด้วยกล้องอัลตร้าไวด์, ไวด์ และเทเลโฟโต้                                        ความละเอียด 12MP\r\nกล้องหน้า TrueDepth ความละเอียด 12MP',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
(10,NULL,NULL,2,'007','Apple iPhone 13 Pro 128GB Sierra Blue',25900,120,'eLhGRo8tDV0OP3MSsBQSiTwCVr8OJf6awd8IZLvn.webp','iPhone 13 Pro การอัปเกรดระบบกล้องระดับโปรครั้งใหญ่ที่สุดเท่าที่เคยมีมา จอภาพ Super Retina XDR พร้อม ProMotion จึงทั้งเร็วขึ้นและรู้สึกได้ถึงการตอบสนองที่ฉับไวยิ่งขึ้น พร้อมชิป A15 Bionic ที่เร็วสุดขั้ว 5G ที่เร็วสุดแรง แถมยังมีดีไซน์ที่ทนทานและแบตเตอรี่ที่ใช้งานได้นานขึ้นแบบก้าวกระโดดครั้งใหญ่อีกด้วย\r\n\r\nจอภาพ Super Retina XDR ขนาด 6.1 นิ้ว  \r\nโหมดภาพยนตร์เพิ่มมิติความชัดตื้นและสลับจุดโฟกัสในวิดีโอของคุณโดยอัตโนมัติ\r\nระบบกล้องระดับโปรที่ประกอบด้วยกล้องเทเลโฟโต้, ไวด์ และอัลตร้าไวด์ ความละเอียด 12MP\r\nกล้องหน้า TrueDepth ความละเอียด 12MP  \r\nชิป A15 Bionic เพื่อประสิทธิภาพที่เร็วสุดขั้ว\r\nเล่นวิดีโอ นานสูงสุด 22 ชั่วโมง',NULL,'Apple ',0,0,'Uncategorized',NULL,NULL,NULL,24),
